  {
   "cell_type": "markdown",
   "id": "a00f9037",
   "metadata": {},
   "source": [
    "Considering that our sample size is very large, $8580$ observations, we can invoke the central limit theorem to maintain the upper bound on our plots as $2$ standard deviations above the mean and set the lower bound to zero because the values in each column are non-negative.\n",
    "\n",
    "Bounding these plots utilizing the central limit theorem provides better visual detail in the data while still utilizing $95$% of the data."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 92,
   "id": "4cc0a9e3",
   "metadata": {},
   "outputs": [],
   "source": [
    "# creating function to plot .describe() statistics in a normal distribution\n",
    "\n",
    "def describe_normalplots(df):\n",
    "    for i, column in enumerate(df.columns):\n",
    "        mean = df.loc['mean', column]\n",
    "        sd = df.loc['std', column]\n",
    "        plot_min = df.loc['min', column]\n",
    "        \n",
    "        x = np.linspace(plot_min, mean + 2*sd)\n",
    "        pdf = norm.pdf(x, mean, sd)\n",
    "        \n",
    "        plt.axvline(mean, color = 'lightblue', linestyle = '--', lw = 2, label = f'Mean {mean:.2f}')\n",
    "        plt.plot(x, pdf, label=f'mu = {mean:.2f}, sigma = {sd:.2f}', lw = 2)\n",
    "        plt.fill_between(x, pdf, color='lightgrey', alpha=0.3)\n",
    "        plt.title(f'Distribution for {column}')\n",
    "        plt.xlabel(f'{column}')\n",
    "        plt.ylabel('probability density')\n",
    "        plt.tight_layout()\n",
    "        plt.legend()\n",
    "        plt.show()"
   ]
  },
