  {
   "cell_type": "markdown",
   "id": "90e2788d",
   "metadata": {},
   "source": [
    "Similarly to above, I am going to utilize the central limit theorem in the same method to improve these plots. I am going to write a function reduce the data to the 95% we want to look at."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 51,
   "id": "251bca6c",
   "metadata": {},
   "outputs": [],
   "source": [
    "# inputs are a dataframe and the name of the column as a string.\n",
    "\n",
    "def dfreduce_normaldist(data, column):\n",
    "    mean = np.mean(dat[column])\n",
    "    sd = np.std(dat[column])\n",
    "    \n",
    "    lowerbound = 0\n",
    "    upperbound = mean + 2*sd\n",
    "    \n",
    "    plot_data = dat[(dat[column] >= lowerbound) & (dat[column] <= upperbound)]\n",
    "    return plot_data"
   ]
  },
